import React from "react";
import s from "./Footer.module.scss";

export const Footer = () => {
  return (
    <footer className="footer mt-auto py-3 bg-light">
    <div className="container">
      <span className={s.test}>Place sticky footer content here.</span>
    </div>
  </footer>
  );
};
